		const { lineWidth, glowWidth, alphaFade } = this._orbitLinesOpts;
		const color = this._colors[entity.getName()] ?? this._colors.default;

		orbitLine.setColor(color);
		orbitLine.setPixelSpaceRadiiAlphaFade(...alphaFade);
